import { useRef } from "react";
import { Tabs, Tab } from "react-bootstrap";
import { Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

import "./Topbar.css";

function Navbar() {
  const navRef = useRef();

  const showNavbar = () => {
    navRef.current.classList.toggle("responsive_nav");
  };

  return (
    <header>
      <h3>LOGO</h3>
      <nav ref={navRef}>
        <Tabs defaultActiveKey="/home" id="navbar-tabs">
          <Tab eventKey="/home" title={<Link to="/home">Home</Link>}>
            {/* Content for Home tab if needed */}
          </Tab>
          <Tab eventKey="/profile" title={<Link to="/profile">My work</Link>}>
            {/* Content for My work tab if needed */}
          </Tab>
          <Tab eventKey="/contact" title={<Link to="/contact">Blog</Link>}>
            {/* Content for Blog tab if needed */}
          </Tab>
          <Tab eventKey="/about" title={<Link to="/about">About me</Link>}>
            {/* Content for About me tab if needed */}
          </Tab>
        </Tabs>
      </nav>
    </header>
  );
}

export default Navbar;
